import { TextField, Button, Grid, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography, FormControlLabel, Checkbox } from "@mui/material";
import { useState, useEffect } from "react";
import axios from "axios";

const CreateTask = () => {
  const [formData, setFormData] = useState({
    task: "",
    desc: "",
    completed: false,
  });

  const [tasks, setTasks] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/tasks")
      .then((response) => setTasks(response.data))
      .catch((error) => console.error("Error fetching tasks:", error));
  }, []);

  const handleClear = () => {
    setFormData({ task: "", desc: "", completed: false });
  };

  const handleTextChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleCheckboxChange = () => {
    setFormData((prev) => ({ ...prev, completed: !prev.completed }));
  };

  const handleSubmit = () => {
    const payload = {
      title: formData.task,
      description: formData.desc,
      completed: formData.completed,
    };

    axios
      .post("http://localhost:5000/api/tasks", payload)
      .then((response) => {
        setTasks((prev) => [...prev, response.data.task]);
      })
      .catch((error) => console.error("Error adding task:", error));

    handleClear();
  };

  return (
    <div style={{ padding: "20px" }}>
      <Grid container spacing={3}>
        <Grid item md={4} sm={12}>
          <TextField
            name="task"
            label="Task Title"
            variant="outlined"
            onChange={handleTextChange}
            value={formData.task}
            fullWidth
          />
        </Grid>

        <Grid item md={4} sm={12}>
          <TextField
            name="desc"
            label="Description"
            variant="outlined"
            onChange={handleTextChange}
            value={formData.desc}
            fullWidth
          />
        </Grid>

        <Grid item md={4} sm={12}>
          <FormControlLabel
            control={
              <Checkbox
                checked={formData.completed}
                onChange={handleCheckboxChange}
                name="completed"
                color="primary"
              />
            }
            label="Completed"
          />
        </Grid>

        <Grid item md={4} sm={12}>
          <Button variant="contained" onClick={handleSubmit} fullWidth>
            Add Task
          </Button>
        </Grid>

        <Grid item md={4} sm={12}>
          <Button variant="contained" onClick={handleClear} fullWidth>
            Clear
          </Button>
        </Grid>
      </Grid>

      {/* Task List Table */}
      <Paper sx={{ marginTop: "2rem", padding: "1rem" }}>
        <Typography variant="h6" gutterBottom>
          Task List
        </Typography>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Title</TableCell>
                <TableCell>Description</TableCell>
                <TableCell>Completed</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {tasks.map((task) => (
                <TableRow key={task._id}>
                  <TableCell>{task.title}</TableCell>
                  <TableCell>{task.description}</TableCell>
                  <TableCell>{task.completed ? "Yes" : "No"}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>
    </div>
  );
};

export default CreateTask;
